import React from 'react'

const Main = () => {
  return (
    <div className='main'>
        <h1>To Do List</h1>
          <div class="write-box">
            <input type="text" class="text-basic"/>
            <button type="button" id="btnAdd">추가</button>
        </div>
    </div>
  )
}

export default Main;
